import './Footer.scss';

export function Footer() {
    return (
        <footer>
            <div className="row">
                <div className="col-sm-12 app_developer">
                    <ul>
                        <li className="app_developer--item"> Powered by <b>OLANREWAJU</b></li>


                    </ul>
                </div>
            </div>
        </footer>
    )
}
